    public static void MakeTunnel(int x, int y, Vector2 beginPoint, Vector2 endPoint, int thickness = 20)
    {
        Utils.BoreTunnel(x + (int)beginPoint.X, y + (int)beginPoint.Y, x + (int)endPoint.X, y + (int)endPoint.Y, thickness, ushort.MaxValue, 0);
    }
    public static void MakeTunnelHollow(int x, int y, Vector2 beginPoint, Vector2 endPoint, int thicknessTunnel = 20, int thicknessHollow = 10)
    {
        int offset = (thicknessTunnel / 2) - (thicknessHollow / 2);
        Utils.BoreTunnel(x + (int)beginPoint.X + offset, y + (int)beginPoint.Y + offset, x + (int)endPoint.X + offset, y + (int)endPoint.Y + offset, thicknessHollow, ushort.MaxValue, WallID.Wood);
    }
    public static bool AddHellcastleChest(int i, int j, bool notNearOtherChests = false)
    {
        int k = j;
        while (k < Main.maxTilesY)
        {
            if (Main.tile[i, k].HasTile && Main.tileSolid[Main.tile[i, k].TileType])
            {
                int num = k;
                int num2 = WorldGen.PlaceChest(i - 1, num - 1, (ushort)ModContent.TileType<Tiles.Furniture.ResistantWood.ResistantWoodChest>(), notNearOtherChests);
                if (num2 >= 0)
                {
                    int loot = WorldGen.genRand.Next(3); // add ranged and summon weapon maybe

                    // ADD LATER

                    if (loot == 0)
                    {
                        Main.chest[num2].item[0].SetDefaults(ModContent.ItemType<Items.Accessories.Hardmode.RingofArrogance>(), false);
                        Main.chest[num2].item[0].Prefix(-1);
                    }
                    if (loot == 1)
                    {
                        Main.chest[num2].item[0].SetDefaults(ModContent.ItemType<Items.Weapons.Magic.Hardmode.Boomlash>(), false);
                        Main.chest[num2].item[0].Prefix(-1);
                    }
                    if (loot == 2)
                    {
                        Main.chest[num2].item[0].SetDefaults(ModContent.ItemType<Items.Weapons.Melee.Hardmode.PossessedFlamesaw>(), false);
                        Main.chest[num2].item[0].Prefix(-1);
                    }
                    Main.chest[num2].item[1].SetDefaults(ModContent.ItemType<Items.Placeable.Tile.ImperviousBrick>(), false);
                    Main.chest[num2].item[1].stack = WorldGen.genRand.Next(200, 451);
                    int rand = WorldGen.genRand.Next(4);
                    if (rand == 0)
                    {
                        Main.chest[num2].item[2].SetDefaults(ModContent.ItemType<BloodCastPotion>(), false);
                        Main.chest[num2].item[2].stack = WorldGen.genRand.Next(2, 4);
                    }
                    if (rand == 1)
                    {
                        Main.chest[num2].item[2].SetDefaults(ModContent.ItemType<LeapingPotion>(), false);
                        Main.chest[num2].item[2].stack = WorldGen.genRand.Next(2, 5);
                    }
                    if (rand == 2)
                    {
                        Main.chest[num2].item[2].SetDefaults(ModContent.ItemType<CloverPotion>(), false);
                        Main.chest[num2].item[2].stack = WorldGen.genRand.Next(3) + 1;
